import "./Acceuil.css"
import Proposer from "../../Components/proposer/proposer";
import IciNous from "../../Components/IciNous/IcuNous";
import ServiceNous from "../../Components/ServiceNous/ServiceNous";

function Acceuil() {
    return (
        <>
            <div className="header "></div>
            {/******************* * / A PROPOS NOTER SITE ***********************/}
            <Proposer title="A propos de notre site." subtitle="Les campeurs du monde entier sont les bienvenus."></Proposer>
            {/******************* * /ICI NOUS CAMPINER ***********************/}
            <IciNous></IciNous>

            <Proposer title="Nos Services" subtitle="campiner offer"></Proposer>
            <ServiceNous></ServiceNous>

            <Proposer title="Map De Centre De Camping" ></Proposer>          
            <iframe src="https://www.google.com/maps/embed?pb=!1m16!1m12!1m3!1d3346561.1574214622!2d7.676157518966375!3d35.00354763175593!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!2m1!1scamping%20tunisie!5e0!3m2!1sfr!2stn!4v1649609193358!5m2!1sfr!2stn"
            width="70%" height="380" style="border:0; border-radius: 30px;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>  
        </>
    );
}

export default Acceuil;
